import React, { Component } from "react";
import "./App.css";
import TwitForm from "./components/TwitForm";

class App extends Component {
  state = {};
  render() {
    return (
      <div id="wrapper">
        <header id="header">TWITTLER</header>

        <TwitForm />
      </div>
    );
  }
}

export default App;
